  const V2_FACTORY_ADDRESS = "0xAAA16c016BF556fcD620328f0759252E29b1AB57";
  
  async function main() {
    const App = await init_ethers();
  
    _print(`Initialized ${App.YOUR_ADDRESS}\n`);
    _print("Loading nuri gauges...\n");
  
    const FLOW_VOTER_ADDR = "0xAAAf3D9CDD3602d117c67D80eEC37a160C8d9869"
    const FLOW_VOTER_CONTRACT = new ethcall.Contract(FLOW_VOTER_ADDR, FLOW_VOTER_ABI);

    const rewardTokenAddress = "0xAAAE8378809bb8815c08D3C59Eb0c7D1529aD769";
  
    const V2_FACTORY_CONTRACT = new ethcall.Contract(V2_FACTORY_ADDRESS, V2_NURI_FACTORY_ABI);
  
    let lpTokens = [], calls = [], v2_gauges_array = [], cl_gauges_array = [];
  
    const [_poolLength] = await App.ethcallProvider.all([FLOW_VOTER_CONTRACT.length()]);
    const poolLength = _poolLength / 1;
    const _calls = [...Array(poolLength).keys()].map(i => FLOW_VOTER_CONTRACT.pools(i));
    while (_calls.length > 0) {
      calls.push(_calls.splice(0, 200));
    }
    for(const call of calls){
      const _lpTokens = await App.ethcallProvider.all(call);
      const calls2 = _lpTokens.map(a => FLOW_VOTER_CONTRACT.gauges(a));
      const gauges = await App.ethcallProvider.all(calls2);
      const lpTokenBatch = [];
      for (let i = 0; i < gauges.length; i++) {
        lpTokenBatch.push({
          lpToken: _lpTokens[i],
          gauge: gauges[i]
        })
      }
      lpTokens.push(lpTokenBatch);
    }
  
    let cl_pools = [], userV2Gauges = [];
    
    for(const lpTokenBatch of lpTokens){
      let v2_pools = [], allPools = [];
      const isPoolCalls = lpTokenBatch.map(pool => V2_FACTORY_CONTRACT.isPair(pool.lpToken));
      const isPools = await App.ethcallProvider.all(isPoolCalls);
    
      for(let i = 0; i < lpTokenBatch.length; i++){
        const pool = {isV2: isPools[i], ...lpTokenBatch[i]}
        allPools.push(pool);
      }
    
      for(const pool of allPools){
        if(pool.isV2){
          v2_pools.push(pool)
        }else{
          cl_pools.push(pool);
        }
      }
    
      const v2_gauge_contracts = v2_pools.map(a => new ethcall.Contract(a.gauge, FLOW_GAUGE_ABI));
      const rewardData_calls = v2_gauge_contracts.map(c => c.rewardData(rewardTokenAddress));
      const rewardsData = await App.ethcallProvider.all(rewardData_calls);

      for(let i = 0; i < v2_pools.length; i++){
        if((Date.now() / 1000 < rewardsData[i].periodFinish && rewardsData[i].rewardRate > 0)){
          v2_gauges_array.push(v2_pools[i].gauge)
        }
      }
    }

    const v2_gages_to_lowercase = v2_gauges_array.map(a => a.toLowerCase());
    const cl_gages_to_lowercase = cl_pools.map(c => c.gauge.toLowerCase());

  // starting second part of the script

    // http request to vfat-api
    const response = await $.ajax({
      url: 'https://api.vfat.io/v1/farms',
      type: 'GET',
    });

    const response2 = await $.ajax({
      url: 'https://api.vfat.io/v1/tokens?chainId=534352&pageSize=999',
      type: 'GET',
    });

    const vfat_io_tokens = response2.tokens.map(t => t.address.toLowerCase());

    const vfat_gauges = response.filter(d => d.chainId == 534352).map(ob => ob.address.toLowerCase());

    let missing_v2_gauges = [];
    let missing_cl_gauges = [];
    let _v2_list = [];
    let _cl_list = [];

    for(const gauge of v2_gages_to_lowercase){
      const is_in_list = vfat_gauges.includes(gauge);
      if(!is_in_list){
          missing_v2_gauges.push(gauge);
      }
  }

  _print_bold("V2 POOLS");
  _print_bold("Missing v2 pools count " + missing_v2_gauges.length);
  _print(``);

  for(const v2_address of missing_v2_gauges){
    const v2_data = await getV2Data(App, v2_address, vfat_io_tokens);
    _v2_list.push(v2_data);
}

_print(``);
  const v2_list = _v2_list.flat();
  const v2_list_no_dublicates = remove_dublicates(v2_list, ob => ob.symbol);
  for(const v2 of v2_list_no_dublicates){
      _print(v2)
  }

  _print(``);

  for(const gauge of cl_gages_to_lowercase){
      const is_in_list = vfat_gauges.includes(gauge);
      if(!is_in_list){
          missing_cl_gauges.push(gauge);
      }
  }

  _print_bold(`CL POOLS`);
  _print(``);

  for(const cl_gauge of missing_cl_gauges){
    const cl_data = await getClData(App, cl_gauge, vfat_io_tokens);
    _cl_list.push(cl_data);
  }

  const cl_list = _cl_list.flat();
  const cl_list_no_dublicates = remove_dublicates(cl_list, ob => ob.symbol);
  for(const cl of cl_list_no_dublicates){
      _print(cl);
  }
  
  hideLoading();
}

  function remove_dublicates(arr, key){
    return [
        ...new Map(
            arr.map(x => [key(x), x])
        ).values()
    ]
  }

async function getClData(App, address, vfat_io_tokens){
const cl_contract = new ethcall.Contract(address, CL_GAUGE_ABI);

const rewardTokenAddress = "0xAAAE8378809bb8815c08D3C59Eb0c7D1529aD769";

let rewardRate;
try{
  [rewardRate] = await App.ethcallProvider.all([cl_contract.rewardRate(rewardTokenAddress)]);
}catch(err){
  return [];
}

if(rewardRate <= 0){
  return [];
}

const [pool] = await App.ethcallProvider.all([cl_contract.pool()]);

const cl_pool_contract = new ethcall.Contract(pool, CL_TOKEN_ABI);
const [token0, token1] = await App.ethcallProvider.all([cl_pool_contract.token0(), cl_pool_contract.token1()]);

const token0Contract = new ethcall.Contract(token0, ERC20_ABI);
const [token0Symbol, token0Decimals] = await App.ethcallProvider.all([token0Contract.symbol(), token0Contract.decimals()])

const token1Contract = new ethcall.Contract(token1, ERC20_ABI);
const [token1Symbol, token1Decimals] = await App.ethcallProvider.all([token1Contract.symbol(), token1Contract.decimals()])

_print(`GAUGE ADDRESS - ${address}`);
_print(`CL TOKEN ADDRESS - ${pool}`);
_print(`TOKEN 0 ADDRESS  - ${token0}`);
_print(`TOKEN 0 SYMBOL  - ${token0Symbol}`);
_print(`TOKEN 0 DECIMALS  - ${token0Decimals}`);
_print(`TOKEN 1 ADDRESS  - ${token1}`);
_print(`TOKEN 1 SYMBOL  - ${token1Symbol}`);
_print(`TOKEN 1 DECIMALS  - ${token1Decimals}`);
_print(``);

if(vfat_io_tokens.includes(token0.toLowerCase()) && vfat_io_tokens.includes(token1.toLowerCase())){
  return []
}else if(vfat_io_tokens.includes(token0.toLowerCase()) && !vfat_io_tokens.includes(token1.toLowerCase())){
  return [
        {
          address: token1,
          symbol: token1Symbol,
          decimals: Number(token1Decimals),
          chainId: 534352
        }
  ]
}else if(!vfat_io_tokens.includes(token0.toLowerCase()) && vfat_io_tokens.includes(token1.toLowerCase())){
  return [
        {
          address: token0,
          symbol: token0Symbol,
          decimals: Number(token0Decimals),
          chainId: 534352
        }
  ]
}else{
  return [
    {
        address: token0,
        symbol: token0Symbol,
        decimals: Number(token0Decimals),
        chainId: 534352
    },
    {
        address: token1,
        symbol: token1Symbol,
        decimals: Number(token1Decimals),
        chainId: 534352
    }
  ]
}
}

